import React from 'react';
import classes from './Dialogs.module.css';


const Dialogs = (props) => {
return(
    <div className={classes.dialogs}>
        <div className={classes.dialogs.item}>
<div className={classes.active}>User 1</div>
<div>User 2</div>
<div>User 3</div>
<div>User 4</div>
<div>User 5</div>
        </div>
  <div>Hi</div>
    </div>

)
}

export default Dialogs;
